import { useState } from "react";

const Login = () => {
    const [signIn, setSignIn] = useState(false);

    return (
        <div className="min-h-screen">
            <form className="flex flex-col shadow-lg justify-center align-center content-center">
                <label>Username</label>
                <input type="text" className="h-8 border border-solid border-black shadow-sky-500" />
                <label>Email</label>
                <input type="email" className="h-8 border border-solid border-black shadow-sky-500" />
                <label>Phone Number</label>
                <input type="tel" className="h-8 border border-solid border-black shadow-sky-500" />
                <label>Password</label>
                <input type="password" className="h-8 border-1 border-solid border-black shadow-sky-500" />
                <label>Confirm Password</label>
                <input type="password" className="h-8 border-1 border-solid border-black shadow-sky-500" />
            </form>
        </div>
    );
};

export default Login;
